import React, { Component } from 'react'

export class Handler extends Component {

    constructor(props) {
        super(props);

        this.state = {
            lvl: props.lvl
        }
    }
    renderSwitch(param) {
        switch (param) {
            case 'Level 2':
                break;
            case 'Level 3':
                break;
            default:
                
                break;
        }
    }


    render() {
        return (
            <div>
                {this.renderSwitch(this.state.lvl)}
            </div>
        )
    }
}

export default Handler
